  input: TEXT,F3A,,"We were able to find several of the contributors' employers and
    occupations.  However, we are still unable to find about five of them.  We will
    continue to make every effort to get the required information on those five and
    will file another amended report if we get responses to our queries.    Also,
    we were able to decrease the negative cash balance substantially but are still
    looking for errors in order to understand why there is still a negative cash balance
    of approximately $4500.        Damon,  as I have not been able to contact you
    this afternoon, I included the candidate's contribution on 11D, though I think
    you told me to put it under 11E.  I could not find an 11E so I'm hoping that either
    I heard you wrong or you meant 11D. Another problem that came up when I did a
    limits check is that two PACs came up as exceeding the limit.  I don't understand
    that since, 1) they never came up before and 2) they are both multicandidate committees
    and should have a $5000 limit and neither have exceeded that.  Since I have a
    deadline and cannot get hold of anyone for assistance, I'm going to file this
    report as is.  Thank you very much for your assistance."
